void Jac(const double a, const double p, const double ecc, const double xi,
		  const double E, const double Lz, const double Q,
		  const double Edot, const double Lzdot, const double Qdot,
		  double & pdot, double & eccdot, double & xidot)
  {
    const double Lz2pQ = Lz*Lz + Q;
    const double LzmaE = Lz - a*E;
    const double omE2 = (1. - E)*(1. + E);
    //
    // Algorithm based on enforcing Rdot(r) = 0, R'dot(r) = 0 and using only
    // (Edot,Lzdot) present but commented out.  Present algorithm based on
    // using only R'dot(r) = 0 with (Edot,Lzdot,Qdot).  Results are almost
    // identical, with tiny differences at the level of numerical errors in
    // the fluxes.
    //
    if (ecc == 0.) {
      const double u2 = 1./p;
      const double denom = u2*(-6*omE2 + u2*(6. + u2*(-a*a*omE2 - Lz2pQ)));
      const double numerEdot = -4.*E + u2*u2*(-2.*a*a*E + u2*(2.*a*LzmaE));
      const double numerLzdot = u2*u2*(2.*Lz + u2*(-2*LzmaE));
      const double numerQdot = u2*u2*(1. - u2);
      pdot = (numerEdot*Edot + numerLzdot*Lzdot + numerQdot*Qdot)/denom;
      eccdot = 0.;
    } 
    else {
      const double ra = p/(1. - ecc), rp = p/(1. + ecc);
      const double ua2 = 1./ra, up2 = 1./rp;
      
      const double denoma = ua2*(-4.*omE2 +
			       ua2*(6 +
				    ua2*(-2*Lz2pQ - 2*a*a*omE2 +
					 ua2*(2.*Lz2pQ - 4.*a*E*Lz + 2.*a*a*E*E))));
      const double denomp = up2*(-4.*omE2 +
			       up2*(6 +
				    up2*(-2*Lz2pQ - 2*a*a*omE2 +
					 up2*(2.*Lz2pQ - 4.*a*E*Lz + 2.*a*a*E*E))));
      
      const double numeraEdot = -2.*(E + ua2*ua2*(a*a*E + ua2*(-2.*a*(LzmaE))));
      const double numeraLzdot = 2.*ua2*ua2*(Lz - 2.*ua2*(LzmaE));
      const double numeraQdot = ua2*ua2*(1 - 2.*ua2 + a*a*ua2*ua2);
      
      const double numerpEdot = -2.*(E + up2*up2*(a*a*E + up2*(-2.*a*(LzmaE))));
      const double numerpLzdot = 2.*up2*up2*(Lz - 2.*up2*(LzmaE));
      const double numerpQdot = up2*up2*(1 - 2.*up2 + a*a*up2*up2);
      
      const double radot = (numeraEdot*Edot + numeraLzdot*Lzdot + numeraQdot*Qdot)/denoma;
      const double rpdot = (numerpEdot*Edot + numerpLzdot*Lzdot + numerpQdot*Qdot)/denomp;
      
      pdot = 0.5*(1 + ecc*(-2. + ecc))*radot + 0.5*(1. + ecc*(2. + ecc))*rpdot;
      eccdot = (1. + ecc)*((1. + ecc*(-2. + ecc))*radot + (ecc*ecc - 1.)*rpdot)/(2.*p);
      if (fabs(eccdot) < 3.e-14) eccdot = 0.;
    }

    if (a == 0) {
      xidot = 0;
    } 
    else {
      double numerx, denomx;
      const double xi2 = xi*xi;
      const double omxi2 = (1. - xi)*(1. + xi);
      if (fabs(xi) < 0.5) {
        numerx = omxi2*(2.*Lzdot*sqrt(omxi2)*sqrt(Q - a*a*omE2*omxi2) - Qdot*xi - 2.*a*a*E*Edot*xi*omxi2);
        denomx = 2.*(Q - a*a*omE2*omxi2*omxi2);
      } 
      else {
        numerx = 2.*Lz*Lzdot*xi*omxi2 - xi*xi2*(Qdot + 2.*a*a*E*Edot*omxi2);
        denomx = 2.*(Lz*Lz + a*a*omE2*xi2*xi2);
      }
      xidot = numerx/denomx;
    }
  }

